import { StyleSheet, Text, View } from 'react-native';

export default function Nav(){

    return(
        <View>
            <Text>List of Pages:</Text>
            <Text>Home Page</Text>
            <Text>Profile Page</Text>
            <Text>About Page</Text>
        </View>
      );
};
